import React, {useState,useEffect} from 'react'
import MenuButton from '../components/MenuButton'
import Student from '../components/Student'
import AddButton from '../components/AddButton'

const StudentsListPage = () => {

    const [students, setStudents] = useState([])

    const getStudents = async()  => 
    {
        const response = await fetch('/students/')
        const data = await response.json()
        setStudents(data)
    }
    console.log(students)
    useEffect(() => {
      getStudents()
    },[])


    return (
      <div className='page' id = "main-page-container">
        <header id="main-page-header">
          Your products
        </header>
        <div id='main-page-content'>
          {students.map((student) => {
              return(
                <Student
                  id = {student.id}
                  name = {student.name}
                  school = {student.school}
                  salary = {student.salary}
                  description = {student.body}
                  single_lesson_time = {student.single_lesson_time}
                  lessons_times = {student.lessons_times}
                  unpaid_time = {student.unpaid_time}
                  holydays = {student.holydays}
                  created_date = {student.created}
                  updated_date = {student.updated}
                  
                  
                />
              )
          })}
         
          
        </div>
        <MenuButton
            button_text = "Home page"
            link_to = "/"
          />
         <AddButton/>

        
         
      </div>
    )
  }

export default StudentsListPage
